CREATE DEFINER=`root`@`localhost` PROCEDURE `getNotifications`(IN pUser INT)
BEGIN
	SELECT id_user_found, id_object, id_notification FROM 
		(SELECT * FROM
			(SELECT
				IF (f.id_user_found = n.id_user,
					n.id_user_raise,
					n.id_user
				) as id_lost, n.*, f.*
			FROM notification n, 
				 (SELECT o.id_user as id_user_found,
						 o.id_object as object_id_object
				  FROM object o,
					   notification n
				  WHERE o.id_object = n.id_object) f) info 
		WHERE info.id_object = object_id_object) lost
	WHERE id_lost = pUser;
END ;;
DELIMITER ;
