CREATE DEFINER=`root`@`localhost` PROCEDURE `getObject`(IN pObject INT)
BEGIN
	SELECT o.description, c.name as categoria, t.name as tipo, color.name as color, o.image,
    z.name as zona, o.matched as estado, o.latitude as latitud, o.longitude as longitud
    FROM object o, category c, type t, zone z, color
    where pObject = o.id_object
    AND t.id_category = c.id_category
    AND t.id_type = o.id_type
    AND o.id_color = color.id_color
    AND o.id_zone = z.id_zone;
END ;;
